import { Box, styled } from '@mui/material'
import { imageURL } from '../../Constants/data'

const MidSection = () => {
    return (
        <Box style={{ display: 'flex' }}>
            {
                  imageURL.map(image => (

                    <img src={image} alt= "img" style={{width: '100%'}}/>
                  ))
            }
        </Box>

    )
}

export default MidSection
